package com.example.entity;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import java.time.LocalDateTime;@Entity@Table(name = "attach")@Data@NoArgsConstructor@AllArgsConstructorpublic class AttachEntity {    @Id    @GeneratedValue(strategy = GenerationType.UUID)    private String id;    @Column    private String originalName;    @Column    private String path;    @Column    private Long size;    @Column    private String extension;    @Column    private LocalDateTime createdData;}